package dmitriy.blanutsa.coursework.controllers.dto;import javax.validation.constraints.NotBlank;import javax.validation.constraints.NotNull;import java.io.Serializable;public class AttorneyPowerRequest implements Serializable {    private static final long serialVersionUID = 5941956931019895413L;    @NotNull(message = "Car is required")    private Integer carId;    @NotNull(message = "Person is required")    private Integer personId;    @NotBlank(message = "From date is required")    private String dateFrom;    @NotBlank(message = "To date is required")    private String dateTo;    public Integer getCarId() {        return carId;    }    public void setCarId(Integer carId) {        this.carId = carId;    }    public Integer getPersonId() {        return personId;    }    public void setPersonId(Integer personId) {        this.personId = personId;    }    public String getDateFrom() {        return dateFrom;    }    public void setDateFrom(String dateFrom) {        this.dateFrom = dateFrom;    }    public String getDateTo() {        return dateTo;    }    public void setDateTo(String dateTo) {        this.dateTo = dateTo;    }}